import React, { useState } from 'react'
import axios from 'axios'
import { useNavigate } from 'react-router-dom'

export default function Login(){
  const [email, setEmail] = useState('')
  const [password, setPassword] = useState('')
  const [err, setErr] = useState('')
  const navigate = useNavigate()

  const onSubmit = async () => {
    try{
      const res = await axios.post('/auth/login', { email, password })
      const token = res.data.access_token
      localStorage.setItem('token', token)
      axios.defaults.headers.common['Authorization'] = `Bearer ${token}`
      navigate('/')
    }catch(e){ setErr(e?.response?.data?.error || 'Login failed') }
  }

  return (
    <div className="max-w-md mx-auto px-6 py-16">
      <h2 className="text-3xl font-extrabold">Login</h2>
      <p className="text-white/60 mt-2 text-sm">No account? <a className="text-primary underline" href="/register">Register</a></p>
      <div className="mt-6 space-y-4">
        <input className="w-full bg-white/10 border border-white/10 rounded px-3 py-2" placeholder="Email" value={email} onChange={e=>setEmail(e.target.value)} />
        <input className="w-full bg-white/10 border border-white/10 rounded px-3 py-2" placeholder="Password" type="password" value={password} onChange={e=>setPassword(e.target.value)} />
        {err && <div className="text-rose-400 text-sm">{err}</div>}
        <button onClick={onSubmit} className="px-5 py-2 rounded bg-primary">Login</button>
      </div>
    </div>
  )
}
